🤔Some of us - parents, struggle to get their children in the bed during night time, and that is a huge problem. They play, they scream, laugh and have a “good time” themselves! Why is it so? The answer is simple - they have been doing something that really makes their happiness hormone grow!🤩
😎We should avoid our kids watching cartoons at least two hours before the bed time, eat sweets or have sweetened drinks, because they contain a lot of sugar! Some parents have overcome this issue by simply starting reading a book for their kids - dim the lights to create a calm atmosphere and read a children book calmly, even if kid is playing around. At some point he will start to listen to the story and will sit down beside you to listen what you’re reading.😏
